script: |
  super -f text -I q523.spq | sort > q523.out

inputs:
  - name: q523.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE ( + - ( - col2 ) ) NOT BETWEEN + col2 * col0 + - - col2 AND + col1 + + + col1;
  - name: tab1

outputs:
  - name: q523.out
    data: |
      51	14	96
      85	5	59
      91	47	68
